import React from 'react'
import "./ContactUs.css";
import ContactSupportIcon from '@material-ui/icons/ContactSupport';
import PhoneForwardedIcon from '@material-ui/icons/PhoneForwarded';

const ContactUs = () => {
    return (
    
        <div className="container contact-container" style={{marginTop:"20px"}}>
        <div className="ctitle">
        <h4 >
        <ContactSupportIcon />
          ContactUs
        </h4>
        </div>
        <div className="row">
        <div className="col" style={{marginLeft:'25px',borderLeft:"2px solid gray"}}>
         <p className="alert alert-info"> CUSTMER CARE <PhoneForwardedIcon style={{marginLeft:"20px",marginRight:"10px"}} />1234567890</p>
         <p>To reach our customer service team please email us at:<p>customerservice@gims.com</p></p>
        </div>
        </div>
        </div>
    
    )
}

export default ContactUs
